MongoDB 3.2 Equivalent of the $mergeObjects Stage<p>I am using the $facet operator in my MongoDB view to run two pipelines on the same data. In the final stage I need to merge these two back together. If we were running Mongo 3.6 I'd use the $mergeObjects operator to do this. However, we're running version 3.2, where $mergeObjects isn't available. So I'm trying to figure out what the 3.2 equivalent of this would be:</p>

<pre><code>{
  $replaceRoot: {
    newRoot: {
      $mergeObjects: ["$pipelineResults", {
        totalCount: "$totalCount.value"
      }]
    }
  }
}
</code></pre>

<p>I've tried using $project, like this:</p>

<pre><code>{
  newRoot: {
    $project: {
      "$pipelineResults": 1,
      totalCount: {
        "$totalCount.value": 1
      }
    }
  }
}
</code></pre>

<p>... but this doesn't work. Maybe I need a combination of $group and $project? What would this look like in 3.2?</p>

