<p>I've tried several different ways of query, but I always get an empty array.</p>

<p>What am I doing wrong?</p>

<p>group.js</p>

<pre><code>let mongoose = require('mongoose');

const Group = mongoose.Schema({
    name: {
        type: String,
        required: true
    },
    users: [{
        userId: {
            type: mongoose.SchemaTypes.ObjectId,
            ref: 'users',
            required: true
        },
        userType: {
            type: String,
            required: true
        },
        userStatus: {
            type: String,
            required: true
        }
    }]
})

module.exports = mongoose.model('group', Group);
</code></pre>

<p>groupController.js</p>

<pre><code>exports.getUserGroups = function (req, res) {
    Group.find({
        "users.userid": "req.user._id"
