}
</code></pre>; Answer: You don't need to call `free()` after each query.  It will get cleaned up automatically when there are no references to the data.  If you overwrite `$data` for each query, that will do it otherwise you can `unset()` the variables when you're done with them, but you probably shouldn't _need_ to.

