How to update an already existing field in MongoDB<p>According to the MongoDB documentation, <a href="https://docs.mongodb.com/manual/reference/operator/update/set/" rel="nofollow noreferrer">$set</a> replaces the value of a field with the specified value or if it doesn't exist will add a new field with the specified value. My question is, how to add to an existing row without replacing an existing one, for example:</p>

<pre><code>{
    "_id" : ObjectId("58dc9feca463e61042d2e462"),
    "email" : "spguillen@yahoo.com",
    "accountType" : "admin",
    "accessKeys" : [
        {
            "keyId" : "d06e6640-2f98-11e7-810b-67d01c2ba6eb",
            "name" : "Admin Key",
            "rights" : [
                "Read",
                "Create",
                "Delete"
            ]
        }
    ]
}
</code></pre>

<p>I want to add the following on the accessKeys field:</p>

<pre><code>{"keyId": "50fcb190-5636-11e7-855a-0d21d5eb6743", "name": "Standard Key", "rights": ["Update"]}
</code></pre>

<p>Without the need to overwrite the existing access keys. Ideally also set a condition for any accounts where <strong>accountType: admin</strong> that if there are no accessKeys, it will set an accessKey field with the access key above yet when there is an access key, append the above access key to the existing one.</p>

