Combine match and lookup in MongoDB aggregate with a boolean OR<p>I want to accomplish the following SQL like operation in MongoDB</p>

<pre><code>SELECT contentItem._id, contentitem.text
FROM contentItems
WHERE contentItem.metadata.color = 'yellow'
UNION
SELECT contentItem._id, contentitem.text
FROM contentItems
WHERE contentItems.contentSets IN (
    SELECT contentSet._id FROM contentSets WHERE contentSet.metadata.color= 'yellow'
)
</code></pre>

<p>this can also be done like this</p>

<pre><code>SELECT contentItem._id, contentitem.text
FROM contentItems
WHERE (
    contentItem.metadata.color = 'yellow'
) OR contentItems.contentSets IN (
    SELECT contentSet._id FROM contentSets WHERE contentSet.metadata.color = 'yellow'
)
</code></pre>

<p>I can do both halves of this</p>

<pre><code>db.getCollection('contentItems').aggregate([
    {
        '$match': {
            'metadata.color': { '$eq': 'yellow' }
        }
    }
])
</code></pre>

<p>and</p>

<pre><code>db.getCollection('contentItems').aggregate([
    {'$unwind': '$contentSets'},
    {
        '$lookup': {
            'from': 'contentSets',
            'localField': 'contentSets',
            'foreignField': '_id',
            'as': 'matchedContentSets'
        }
    },
    {
        '$match': {
            'matchedContentSets.metadata.color': { '$eq': 'yellow' }
        }
    }
])
</code></pre>

<p>but I don't know how to get a UNION of this data.</p>

