Mongo Aggregation to Calculate Unique IDs in Returned Docs is Slow<p>In addition to returning a filtered set of documents to the end user via a Mongo view, I also have a couple functions running to generate running totals. For some reason though, while my <code>find()</code> operation is really fast (225ms), this additional aggregation I'm running takes over 6 seconds to perform -- which slows down the whole endpoint, because this data is passed on in what I'm returning. </p>

<p>I'm trying to understand why this aggregation would be so slow? This aggregation matches to the filters passed in by the end-user, and then calculates the number of unique customer ids that appear in the returned documents. This is what it looks like:</p>

<pre><code>  let totalCustomers = await db
    .collection("view_accounts_report")
    .aggregate([{
        $match: search
      },
      {
        $group: {
          _id: null,
          customers: {
            $addToSet: "$customer._id"
          }
        }
      },
      {
        $project: {
          uniqueCustomers: {
            $size: "$customers"
          }
        }
      }
    ])
    .next();
</code></pre>

